const Tl = () => {
    return ( 
        <div>
            <h1>TÍNH LƯƠNG</h1>
            <table className='table'>
                <thead>
                    <tr>
                        <th>Mã Nhân Viên</th>
                        <th>Tên</th>
                        <th>Chức Vụ</th>
                        <th>Quyền Hạng</th>
                        <th>Tùy Chọn</th>

                    </tr>
                </thead>
                <tbody>
                    {isButtonClicked ? (
                        locnhansu.map(e => {
                            const correspondingChucvu = Chucvus.find((c) => c._id === e.Chucvu);
                            if (correspondingChucvu && +correspondingChucvu.Quyenhang > +UQuyenhang) {
                                return {
                                    _id: e._id,
                                    Hoten: e.Hoten,
                                    Cccd: e.Cccd,
                                    Mnv: e.Mnv,
                                    Sdt: e.Sdt,
                                    luong: e.luong,
                                    Tenchucvu: correspondingChucvu.Tenchucvu,
                                    Quyenhang: correspondingChucvu.Quyenhang,
                                };
                            } else {
                                return null;
                            }
                        })
                            .filter(Boolean) // Lọc bỏ các phần tử null
                            .sort((a, b) => a.Quyenhang - b.Quyenhang) // Sắp xếp theo Quyenhang tăng dần
                            .map((e) => (
                                <tr >
                                    <td>{e.Mnv}</td>
                                    <td>{e.Hoten}</td>
                                    <td>{e.Tenchucvu ? e.Tenchucvu : '-'}</td>
                                    <td>{e.Quyenhang}</td>
                                    <td className='td-tuychon'>
                                        <Link to={'http://localhost:3001/quanlychamcong/quanlycalamviec/chamcongcanhan/&idns=' + e._id} className='btn btn-info btn-sm me-2'>
                                            Chấm Công</Link>
                                        <button className='btn btn-warning btn-sm' onClick={() => { setIdnsedit(e._id); hienthibang(); }}>
                                            Chấm Lại</button>
                                    </td>
                                </tr>
                            ))
                    ) : (
                        Nhansus.map(e => {
                            const correspondingChucvu = Chucvus.find((c) => c._id === e.Chucvu);
                            if (correspondingChucvu && +correspondingChucvu.Quyenhang > +UQuyenhang) {
                                return {
                                    _id: e._id,
                                    Hoten: e.Hoten,
                                    Cccd: e.Cccd,
                                    Mnv: e.Mnv,
                                    Sdt: e.Sdt,
                                    luong: e.luong,
                                    Tenchucvu: correspondingChucvu.Tenchucvu,
                                    Quyenhang: correspondingChucvu.Quyenhang,
                                };
                            } else {
                                return null;
                            }
                        })
                            .filter(Boolean) // Lọc bỏ các phần tử null
                            .sort((a, b) => a.Quyenhang - b.Quyenhang) // Sắp xếp theo Quyenhang tăng dần
                            .map((e) => (
                                <tr >
                                    <td>{e.Mnv}</td>
                                    <td>{e.Hoten}</td>
                                    <td>{e.Tenchucvu ? e.Tenchucvu : '-'}</td>
                                    <td>{e.Quyenhang}</td>
                                    <td className='td-tuychon'>
                                        <Link to={'http://localhost:3001/quanlychamcong/quanlycalamviec/chamcongcanhan/&idns=' + e._id} className='btn btn-info btn-sm me-2'>
                                            Chấm Công</Link>
                                        <button className='bt-chamlai' onClick={() => { setIdnsedit(e._id); hienthibang(); }}>
                                            Chấm Lại</button>
                                    </td>
                                </tr>
                            ))
                    )}
                </tbody>
            </table>
        </div>
     );
}
 
export default Tl;
